const puppeteer = require('puppeteer');

(async () => {
  // Launch browser
  const browser = await puppeteer.launch({ headless: true });
  const page = await browser.newPage();

  // Navigate to saucedemo
  await page.goto('https://www.saucedemo.com');

  // Login
  await page.type('#user-name', 'standard_user');
  await page.type('#password', 'secret_sauce');
  await page.click('#login-button');
  await page.waitForNavigation();

  // Test Case TC_INV_001: Verify product name and image display
  const tc_inv_001_result = await page.evaluate(() => {
    const products = document.querySelectorAll('.inventory_item');
    let allProductsHaveNameAndImage = true;
    products.forEach(product => {
      const name = product.querySelector('.inventory_item_name');
      const image = product.querySelector('.inventory_item_img img');
      if (!name || !name.innerText || !image || !image.src) {
        allProductsHaveNameAndImage = false;
      }
    });
    return allProductsHaveNameAndImage;
  });
  console.log('TC_INV_001 (Product name and image display):', tc_inv_001_result ? 'PASS' : 'FAIL');

  // Test Case TC_INV_002: Check sorting dropdown functionality
  const tc_inv_002_result = await page.evaluate(() => {
    const dropdown = document.querySelector('.product_sort_container');
    if (!dropdown) return false;

    // Helper function to get product names and prices
    const getProductNames = () => Array.from(document.querySelectorAll('.inventory_item_name')).map(e => e.innerText);
    const getProductPrices = () => Array.from(document.querySelectorAll('.inventory_item_price')).map(e => parseFloat(e.innerText.replace('$', '')));

    // Test sorting by name A-Z
    dropdown.value = 'az';
    dropdown.dispatchEvent(new Event('change'));
    const productsAtoZ = getProductNames();
    if (productsAtoZ.slice().sort().join() !== productsAtoZ.join()) return false;

    // Test sorting by name Z-A
    dropdown.value = 'za';
    dropdown.dispatchEvent(new Event('change'));
    const productsZtoA = getProductNames();
    if (productsZtoA.slice().sort().reverse().join() !== productsZtoA.join()) return false;

    // Test sorting by price low to high
    dropdown.value = 'lohi';
    dropdown.dispatchEvent(new Event('change'));
    const pricesLowToHigh = getProductPrices();
    if (pricesLowToHigh.slice().sort((a, b) => a - b).join() !== pricesLowToHigh.join()) return false;

    // Test sorting by price high to low
    dropdown.value = 'hilo';
    dropdown.dispatchEvent(new Event('change'));
    const pricesHighToLow = getProductPrices();
    if (pricesHighToLow.slice().sort((a, b) => b - a).join() !== pricesHighToLow.join()) return false;

    return true;
  });
  console.log('TC_INV_002 (Sorting dropdown functionality):', tc_inv_002_result ? 'PASS' : 'FAIL');

  await browser.close();
})();
